import React from 'react';
import './App.css';
import Home from './components/Home'; 
import Header from './components/Header';


function App() {
  return (
    <div className="App">
      <Header/> 
      <header className="App-header">
        <Home />
      </header>
    </div>
  );
}

export default App;
